import React from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import Team from "./Team";
import { Container, Col } from "react-bootstrap";
import { connect } from "react-redux";

function Employee(props) {
  console.log(
    props.state.employees.find((e) => e.id === props.employee.id),
    "Employeee props"
  );
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: {
      employee: props.state.employees.find((e) => e.id === props.employee.id),
    },
    end: () => {
      console.log(props.employee, "employewwwwwwwwwwwwwwwwe");
    },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));
  const style = {
    backgroundColor: "rgba(255, 255, 255, 0.3)",
    borderRadius: "20px",
  };
  return (
    <Card className="employee" ref={drag} style={style}>
      <CardHeader
        avatar={<Avatar src={props.employee["Avatar"]["url"]} />}
        title={props.employee.Name}
      />
      <Container className="teamsInAlliance">
        { props.state.employees.find((e) => e.id === props.employee.id).teams.map((team) => {
          console.log(team, "Haaaa");
          return <div key={team.id}>{team.Name}</div>;
        })}
      </Container>
    </Card>
  );
}

const mapStateToProps = (state, ownProps) => {
  console.log(state, "staaatree");
  return {
    state: state,
  };
};
export default connect(mapStateToProps)(Employee);
